(3, 9, 'About Shopiya', '<div class=\"row\">\r\n  <div class=\"col-sm\">\r\n<img src=\"https://shopiya.lk/public/uploads/all/z7TeZbrUieeS6PBNcBip0IVQ8S7aPmOIigwV83sX.bin\" alt=\"About Shopiya\" width=\"100%\">\r\n  </div>\r\n\r\n  <div class=\"col-sm\">\r\n<h3 style=\"text-align: center; \">About Shopiya</h3>\r\n<br>\r\n<h6 style=\"text-align: justify; \">    shopiya.lk               online store .</h6>\r\n<h6 style=\"text-align: justify; \">     online         .    ,  ,  ,       online         .  ,  ,     3       \"      \"     online        .\r\n</h6>\r\n<br>\r\n<br>\r\n<h6 style=\"text-align: justify; \">Shopiya.lk is the pioneer of online shopping and shopiya is a huge online store with a wide range of quality products and services to the Sri Lankan Family.</h6>\r\n<h6 style=\"text-align: justify; \">Whatever your needs, we are able to deliver it to you online quickly and easily. Safety, speed of service and quality are our unique feature and we have been able to be a pioneer in the online field with the theme \"Our Steps Are Where You Are\".\r\n</h6>\r\n  </div>\r\n\r\n</div>', 'en', '2021-02-05 08:43:00', '2021-02-11 12:32:48'),
(4, 6, 'Privacy Policy Page', '<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;mso-outline-level:1\"><b><span style=\"font-size:24.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333;mso-font-kerning:18.0pt\">Privacy and Confidentiality<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Welcome to the\r\nshopiya.lk website (the \"Site\") operated by IBIT Academy (Private)\r\nLimited. We respect your privacy and want to protect your personal information.\r\nTo learn more, please read this Privacy Policy.<br>\r\n<br>\r\nThis Privacy Policy explains how we collect, use and (under certain conditions)\r\ndisclose your personal information. This Privacy Policy also explains the steps\r\nwe have taken to secure your personal information. Finally, this Privacy Policy\r\nexplains your options regarding the collection, use and disclosure of your\r\npersonal information. By visiting the Site directly or through another site,\r\nyou accept the practices described in this Policy.<br>\r\n<br>\r\nData protection is a matter of trust and your privacy is important to us. We\r\nshall therefore only use your name and other information which relates to you\r\nin the manner set out in this Privacy Policy. We will only collect information\r\nwhere it is necessary for us to do so and we will only collect information if\r\nit is relevant to our dealings with you.<br>\r\n<br>\r\nWe will only keep your information for as long as we are either required to by\r\nlaw or as is relevant for the purposes for which it was collected.<br>\r\n<br>\r\nYou can visit the Site and browse without having to provide personal details.\r\nDuring your visit to the Site you remain anonymous and at no time can we\r\nidentify you unless you have an account on the Site and log on with your user\r\nname and password.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\"><br>\r\n<!--[if !supportLineBreakNewLine]--><br>\r\n<!--[endif]--></span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;mso-outline-level:4\"><b><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\">1. Data that we collect<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">We may collect various\r\npieces of information if you seek to place an order for a product with us on\r\nthe Site.<br>\r\n<br>\r\nWe collect, store and process your data for processing your purchase on the\r\nSite and any possible later claims, and to provide you with our services. We\r\nmay collect personal information including, but not limited to, your title,\r\nname, gender, date of birth, email address, postal address, delivery address\r\n(if different), telephone number, mobile number, fax number, payment details,\r\npayment card details or bank account details.<br>\r\n<br>\r\nWe will use the information you provide to enable us to process your orders and\r\nto provide you with the services and information offered through our website\r\nand which you request. Further, we will use the information you provide to\r\nadminister your account with us; verify and carry out financial transactions in\r\nrelation to payments you make; audit the downloading of data from our website;\r\nimprove the layout and/or content of the pages of our website and customize\r\nthem for users; identify visitors on our website; carry out research on our\r\nusers\' demographics; send you information we think you may find useful or which\r\nyou have requested from us, including information about our products and\r\nservices, provided you have indicated that you have not objected to being\r\ncontacted for these purposes. Subject to obtaining your consent we may contact\r\nyou by email with details of other products and services. If you prefer not to\r\nreceive any marketing communications from us, you can opt out at any time.<br>\r\n<br>\r\nWe may pass your name and address on to a third party in order to make delivery\r\nof the product to you (for example to our courier or supplier). You must only\r\nsubmit to us the Site information which is accurate and not misleading and you\r\nmust keep it up to date and inform us of changes.<br>\r\n<br>\r\nYour actual order details may be stored with us but for security reasons cannot\r\nbe retrieved directly by us. However, you may access this information by\r\nlogging into your account on the Site. Here you can view the details of your\r\norders that have been completed, those which are open and those which are\r\nshortly to be dispatched and administer your address details, bank details (\r\nfor refund purposes) and any newsletter to which you may have subscribed. You\r\nundertake to treat the personal access data confidentially and not make it\r\navailable to unauthorized third parties. We cannot assume any liability for\r\nmisuse of passwords unless this misuse is our fault.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;mso-outline-level:4\"><b><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\">Other uses of your Personal Information<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">We may use your\r\npersonal information for opinion and market research. Your details are anonymous\r\nand will only be used for statistical purposes. You can choose to opt out of\r\nthis at any time. Any answers to surveys or opinion polls we may ask you to\r\ncomplete will not be forwarded on to third parties. Disclosing your email\r\naddress is only necessary if you would like to take part in competitions. We\r\nsave the answers to our surveys separately from your email address.<br>\r\n<br>\r\nWe may also send you other information about us, the Site, our other websites,\r\nour products, sales promotions, our newsletters, anything relating to other\r\ncompanies in our group or our business partners. Within 7 working days (days\r\nwhich are neither (i) a Sunday, nor (ii) a public holiday anywhere in Srilanka)\r\nof receipt of your instruction we will cease to send you information as requested.\r\nIf your instruction is unclear we will contact you for clarification.<br>\r\n<br>\r\nWe may further anonymize data about users of the Site generally and use it for\r\nvarious purposes, including ascertaining the general location of the users and\r\nusage of certain aspects of the Site or a link contained in an email to those\r\nregistered to receive them, and supplying that anonymized data to third parties\r\nsuch as publishers. However, that anonymized data will not be capable of\r\nidentifying you personally.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;mso-outline-level:4\"><b><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\">Third Parties and Links<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">We may pass your\r\ndetails to other companies in our group. We may also pass your details to our\r\nagents and subcontractors to help us with any of our uses of your data set out\r\nin our Privacy Policy. For example, we may use third parties to assist us with\r\ndelivering products to you, to help us to collect payments from you, to analyze\r\ndata and to provide us with marketing or customer service assistance.<br>\r\n<br>\r\nWe may exchange information with third parties for the purposes of fraud\r\nprotection and credit risk reduction. We may transfer our databases containing\r\nyour personal information if we sell our business or part of it. Other than as\r\nset out in this Privacy Policy, we shall NOT sell or disclose your personal\r\ndata to third parties without obtaining your prior consent unless this is\r\nnecessary for the purposes set out in this Privacy Policy or unless we are\r\nrequired to do so by law. The Site may contain advertising of third parties and\r\nlinks to other sites or frames of other sites. Please be aware that we are not responsible\r\nfor the privacy practices or content of those third parties or other sites, nor\r\nfor any third party to whom we transfer your data in accordance with our\r\nPrivacy Policy.</span></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">\r\n<!--[if !supportLineBreakNewLine]--><br>\r\n<!--[endif]--></span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;mso-outline-level:4\"><b><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\">2. Cookies<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">The acceptance of\r\ncookies is not a requirement for visiting the Site. However we would like to\r\npoint out that the use of the \'basket\' functionality on the Site and ordering\r\nis only possible with the activation of cookies. Cookies are tiny text files\r\nwhich identify your computer to our server as a unique user when you visit\r\ncertain pages on the Site and they are stored by your Internet browser on your\r\ncomputer\'s hard drive. Cookies can be used to recognize your Internet Protocol\r\naddress, saving you time while you are on, or want to enter, the Site. We only\r\nuse cookies for your convenience in using the Site (for example to remember who\r\nyou are when you want to amend your shopping cart without having to re-enter\r\nyour email address) and not for obtaining or using any other information about\r\nyou (for example targeted advertising). Your browser can be set to not accept\r\ncookies, but this would restrict your use of the Site. Please accept our\r\nassurance that our use of cookies does not contain any personal or private\r\ndetails and are free from viruses. If you want to find out more information\r\nabout cookies, go to http://www.allaboutcookies.org or to find out about\r\nremoving them from your browser, go to\r\nhttp://www.allaboutcookies.org/manage-cookies/index.html.<br>\r\n<br>\r\nThis website uses Google Analytics, a web analytics service provided by Google,\r\nInc. (\"Google\"). Google Analytics uses cookies, which are text files\r\nplaced on your computer, to help the website analyze how users use the site.\r\nThe information generated by the cookie about your use of the website\r\n(including your IP address) will be transmitted to and stored by Google on\r\nservers in the United States. Google will use this information for the purpose\r\nof evaluating your use of the website, compiling reports on website activity\r\nfor website operators and providing other services relating to website activity\r\nand internet usage. Google may also transfer this information to third parties\r\nwhere required to do so by law, or where such third parties process the\r\ninformation on Google\'s behalf. Google will not associate your IP address with any\r\nother data held by Google. You may refuse the use of cookies by selecting the\r\nappropriate settings on your browser, however please note that if you do this\r\nyou may not be able to use the full functionality of this website. By using\r\nthis website, you consent to the processing of data about you by Google in the\r\nmanner and for the purposes set out above.</span></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;mso-outline-level:4\"><b><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\">3. Security<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">We have in place\r\nappropriate technical and security measures to prevent unauthorized or unlawful\r\naccess to or accidental loss of or destruction or damage to your information.\r\nWhen we collect data through the Site, we collect your personal details on a\r\nsecure server. We use firewalls on our servers. Our security procedures mean\r\nthat we may occasionally request proof of identity before we disclose personal\r\ninformation to you. You are responsible for protecting against unauthorized\r\naccess to your password and to your computer.</span></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;mso-outline-level:4\"><b><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\">4. Your rights<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">If you are concerned\r\nabout your data you have the right to request access to the personal data which\r\nwe may hold or process about you. You have the right to require us to correct\r\nany inaccuracies in your data free of charge. At any stage you also have the\r\nright to ask us to stop using your personal data for direct marketing purposes.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>', 'en', '2021-02-25 07:22:36', '2021-02-25 07:22:36');
