(120, 'IKEA 365+ Food Container. Rectangular. Glass. 1 ltr', 'admin', 9, 40, NULL, '518,526', '512', 'youtube', NULL, 'glass,food,container,microwave,jar', '<h4><font color=\"#ff0000\"><b>IKEA 365+ Food Container. Rectangular. Glass. 1 ltr \r\n</b></font></h4><p>Store/Home &amp; Lifestyles/IKEA Collections \r\n</p><p>IKEA 365+ Food Container. Rectangular. Glass. 1 ltr \r\n</p><p>SKU IKEA-103.592.01 \r\n</p><p>Product Details \r\n</p><p>Brand: IKEA \r\n</p><p>Weight: 0.68 kg \r\n</p><p>Product description \r\n</p><p>Helps you take care of food  and the planet \r\n</p><p>If you want to reduce food waste but sometimes think its a bit of a pain to take care of your food, this might help. IKEA 365+ food storage products make it easier to store, save and bring food with you on the go. To get to know more about peoples needs, we visited families in several countries. We found out that its all about versatility and simplicity. \r\n</p><p>Youve just put leftovers after eating into a food container, but cant find a lid that fits. Or maybe youve put a food container in the fridge with food in it, but you cant see whats inside the food container and completely forget about the food. These were things we heard time and time again when interviewing families about their experiences. We wanted to develop products to make this easier, says David \r\n</p><p>Granath, a product developer who has worked with the project. They should be simple and flexible. \r\n</p><p>And easy to combine and use in ways that suit every household. \r\n</p><p>No extra work \r\n</p><p>It can involve things like using the same food container for several steps and just changing the lid. There shouldnt be any unnecessary extra work along the way, says David. Transparent containers increase the chances that the food is consumed. And it must be easy to adapt the containers to serve different needs. People asked for a coherent system for food storage. Not complicated special gadgets, yet rather simple and straightforward products that can be used often. \r\n</p><p>Smart and super simple \r\n</p><p>The IKEA 365+ food containers and lids can be combined and also come in different materials and sizes. They are super simple  and thats the point. Weve put a lot of work into them, for example by seeing to it that all the different parts fit together. But the product itself is simple in a smart way. We cant solve the entire food waste problem  but we can make it possible for everyone to be part of the solution. \r\n</p><p>The food container is made of oven-safe glass and can be used as an oven/serving dish. \r\n</p><p>Made of glass, which does not absorb odours or discolour from tomato sauce, etc, so the food container is easy to clean. \r\n</p><p>The transparent jar makes it easy to find what you are looking for, regardless of where it is placed. \r\n</p><p>Please refer to packaging label for country of origin Fits with IKEA 365+ rectangular-shaped lids. \r\n</p><p>Wash this product before using it for the first time. \r\n</p><p>Designer \r\n</p><p>Sarah Fager \r\n</p><p>Product dimensions \r\n</p><p>Length: 21 cm \r\n</p><p>Width: 15 cm \r\n</p><p>Height: 6 cm \r\n</p><p>Volume: 1.0 l \r\n</p><p>Care instructions Microwave-safe. \r\n</p><p>Freezer-safe. \r\n</p><p>Dishwasher-safe. \r\n</p><p>Oven-safe. \r\n</p><p>Environment and materials \r\n</p><p>Environment \r\n</p><p>No cadmium or lead added. \r\n</p><p>By creating products that help people minimize waste, we contribute to enabling a more sustainable life at home. \r\n</p><p>Materials \r\n</p><p>Heat resistant glass \r\n</p><p>Packaging info \r\n</p><p>IKEA 365+ \r\n</p><p>Food container \r\n</p><p>Width15 Cm \r\n</p><p>Height6 Cm \r\n</p><p>Length21 Cm \r\n</p><p>Weight0.68 Kg \r\n</p><p>Number of packages 1 \r\n</p><p>Designers concept \r\n</p><p>Borosilicate glass can handle conditions that are a bit too tough for ordinary household glass. Its very impact and scratch resistant and withstands rapid temperature changes, allowing you to take it directly from the freezer to the oven  or vice versa. And if it somehow breaks, it shatters into large pieces with less risk of someone getting hurt. Simply a tougher type of glass. \r\n</p><p><br></p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p>', 1440.00, NULL, 0, '[]', '[]', '[]', NULL, 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, 5, 0.00, 'amount', 1632767400, 1698517740, NULL, NULL, 'flat_rate', '300', 1, 3, 0, 'IKEA 365+ Food Container. Rectangular. Glass. 1 ltr', 'IKEA 365+ Food Container. Rectangular. Glass. 1 ltr \r\nStore/Home &amp; Lifestyles/IKEA Collections \r\nIKEA 365+ Food Container. Rectangular. Glass. 1 ltr \r\nSKU IKEA-103.592.01 \r\nProduct Details \r\nBrand: IKEA \r\nWeight: 0.68 kg \r\nProduct description \r\nHelps you take care of food  and the planet \r\nIf you want to reduce food waste but sometimes think its a bit of a pain to take care of your food, this might help. IKEA 365+ food storage products make it easier to store, save and bring food with you on the go. To get to know more about peoples needs, we visited families in several countries. We found out that its all about versatility and simplicity. \r\nYouve just put leftovers after eating into a food container, but cant find a lid that fits. Or maybe youve put a food container in the fridge with food in it, but you cant see whats inside the food container and completely forget about the food. These were things we heard time and time again when interviewing families about their experiences. We wanted to develop products to make this easier, says David \r\nGranath, a product developer who has worked with the project. They should be simple and flexible. \r\nAnd easy to combine and use in ways that suit every household. \r\nNo extra work \r\nIt can involve things like using the same food container for several steps and just changing the lid. There shouldnt be any unnecessary extra work along the way, says David. Transparent containers increase the chances that the food is consumed. And it must be easy to adapt the containers to serve different needs. People asked for a coherent system for food storage. Not complicated special gadgets, yet rather simple and straightforward products that can be used often. \r\nSmart and super simple \r\nThe IKEA 365+ food containers and lids can be combined and also come in different materials and sizes. They are super simple  and thats the point. Weve put a lot of work into them, for example by seeing to it that all the different parts fit together. But the product itself is simple in a smart way. We cant solve the entire food waste problem  but we can make it possible for everyone to be part of the solution. \r\nThe food container is made of oven-safe glass and can be used as an oven/serving dish. \r\nMade of glass, which does not absorb odours or discolour from tomato sauce, etc, so the food container is easy to clean. \r\nThe transparent jar makes it easy to find what you are looking for, regardless of where it is placed. \r\nPlease refer to packaging label for country of origin Fits with IKEA 365+ rectangular-shaped lids. \r\nWash this product before using it for the first time. \r\nDesigner \r\nSarah Fager \r\nProduct dimensions \r\nLength: 21 cm \r\nWidth: 15 cm \r\nHeight: 6 cm \r\nVolume: 1.0 l \r\nCare instructions Microwave-safe. \r\nFreezer-safe. \r\nDishwasher-safe. \r\nOven-safe. \r\nEnvironment and materials \r\nEnvironment \r\nNo cadmium or lead added. \r\nBy creating products that help people minimize waste, we contribute to enabling a more sustainable life at home. \r\nMaterials \r\nHeat resistant glass \r\nPackaging info \r\nIKEA 365+ \r\nFood container \r\nWidth15 Cm \r\nHeight6 Cm \r\nLength21 Cm \r\nWeight0.68 Kg \r\nNumber of packages 1 \r\nDesigners concept \r\nBorosilicate glass can handle conditions that are a bit too tough for ordinary household glass. Its very impact and scratch resistant and withstands rapid temperature changes, allowing you to take it directly from the freezer to the oven  or vice versa. And if it somehow breaks, it shatters into large pieces with less risk of someone getting hurt. Simply a tougher type of glass.', '512', NULL, 'ikea-365-food-container-rectangular-glass-1-ltr-mkqlp', 0.00, NULL, 0, 0, NULL, NULL, '2021-09-28 09:17:31', '2021-10-02 03:47:16');
