e is a premium alcohol-based hand sanitizer. MediSafe hand disinfectant is a complete bactericidal, viricidal, and fungicidal alcohol-based hand-rub disinfectant manufactured in accordance with USP formula and WHO guidelines.\r\nComposition:\r\nIsopropyl Alcohol  75% (v/v)\r\nHydrogen Peroxide  0.125% (v/v)\r\nGlycerine BP  1.45% (v/v)\r\nAqua QSDIRECTIONS TO USE :Hygenic Hand Disinfection:\r\nRub Medisafe (3ml) 21.5ml pushes from the calibrated pump, Thoroughly clean area of hands, nail grooves for 30 seconds.\r\nSurgical Hand Disinfection: \r\nRub Medisafe (9ml) 61.5ml pushes from the calibrated pump, Thoroughly clean area of hands, nail grooves for 30 seconds.', '553', NULL, '50ml-flip-top-cap-v1g69', 0.00, NULL, 0, 0, NULL, NULL, '2021-09-29 12:02:06', '2021-09-30 12:11:12'),
