(106, 110, 'OMAYEE Men\'s Short Underwear', '2 pieces', '<h5><b><font color=\"#ff0000\">OMAYEE Men\'s Short Underwear</font></b></h5><p>Omayee underwear with plain and printed 2 pack combinations with various colours.<br></p><p>The packs are comes with the combination shows as in variation pictures\r\n</p><p>95% Cotton and 5% Spandex\r\n</p><p>Logo printed waistband</p><p><br></p><p><br></p><table class=\"table table-bordered\"><tbody><tr><td>SIZE</td><td>XS</td><td>S</td><td>M</td><td>L</td><td>XL</td><td>2XL</td></tr><tr><td>CM</td><td>61-66</td><td>71-76</td><td>81-86</td><td>91-96</td><td>102-107</td><td>112-117</td></tr><tr><td>INCH</td><td>24-26</td><td>28-30</td><td>32-34</td><td>36-38</td><td>40-42</td><td>44-46</td></tr></tbody></table><p> \r\n</p><p><b style=\"background-color: rgb(255, 255, 0);\">&nbsp;Condition: Brand-new original packaging\r\n</b></p><p><b style=\"background-color: rgb(255, 255, 0);\">Sizes: XS,S,M,L,XL,XXL\r\n</b></p><p><b style=\"background-color: rgb(255, 255, 0);\">Character: Plane &amp; Printed\r\n</b></p><p><b style=\"background-color: rgb(255, 255, 0);\">Colour: Multicolour\r\n</b></p><p><b style=\"background-color: rgb(255, 255, 0);\">Material : 95% cotton, 5% spandex\r\n</b></p><p><b style=\"background-color: rgb(255, 255, 0);\">Style: Boxer brief logo print waistband\r\n</b></p><p><b style=\"background-color: rgb(255, 255, 0);\">Garment care: Machine washable\r\n</b></p><p><b style=\"background-color: rgb(255, 255, 0);\">Type: Mens Underwear\r\n</b></p><p><b style=\"background-color: rgb(255, 255, 0);\">Brand: Omayee\r\n</b></p><p><b style=\"background-color: rgb(255, 255, 0);\">Features :All seasons, stretch</b></p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-09-15 06:43:55', '2021-09-15 06:56:30'),
(107, 111, 'MEGHA PRIMAL INTAKE', '1 pack', '<h4><b>WHAT ARE THE<br>\r\nINGREDIENTS?\r\n</b></h4><p>Ginger (Zingiber officinale)\r\n</p><p>not only tastes good, but it is a powerful anti-inflammatory.\r\n</p><p>Garlic (Allium sativum)\r\n</p><p>is a powerful immune boosting food item that can fight viral conditions such as common cold and its related symptoms of sneezing, coughing, sore throat and runny nose. \r\n</p><p>Coriander (Coriandrum sativum)\r\n</p><p>These antioxidants include terpinene, quercetin, and tocopherols. These antioxidants are proved to have immune-boosting and anti-cancer effects. \r\n</p><p>Holy Basil (Ocimum  sanctum)\r\n</p><p>Benefits holds substantial anti-inflammatory and immune boosting elements that fight against stress, fever, pain and even protect vital organs.\r\n</p><p>Sweet Flag (Acorus  calamus)\r\n</p><p>Acts as an antibiotic preventing various internal and external infections.\r\n</p><p>Malabar Nut (Justicia adhatoda)\r\n</p><p>The leaves of Justicia adhatoda contains phytochemicals such as alkaloids, tannins, saponins, phenolics and flavonoids</p><p><br></p><p>\r\n</p><h5><b>HOW IT HELPS?</b></h5><h5><b><br></b></h5><h5><b>\r\n</b></h5><h6><b>Prevents Cytokine Storms\r\n</b></h6><p>Inflammation is a natural immune response that your body has when its under stress. In simple terms, think about a workout. You stress your muscles during a workout and then what happens? You get soreyou experience inflammation. The same thing happens on a cellular level. When a pathogen enters the body like a virus or bacteria or even a toxin, the body goes into protective mode and inflammatory cytokines are used as a defense mechanism. This protects the body from harm. However, in excess, these cytokines can cause major problems\r\n</p><h6><b><br></b></h6><h6><b>Impact on cold virus\r\n</b></h6><p>Allicin, a sulphur containing compound in garlic has been found as the most useful agent in fighting cold. Other components such as saponins and amino acid derivatives have also been found to play an important role in reducing the impact of cold virus and shortening its stay in the body. A combinations of minerals such as sulphur, Selenium with various enzymes help to fight cold virus. Studies have revealed that the people who take garlic gets faster relief from the cold as compared to people who do not take garlic. Overall garlic is antiviral antibiotic and antiseptic natural product to not only help you fight the symptoms of cold but also improve your overall health.\r\n</p><h6><b><br></b></h6><h6><b>Impact on the central nervous system\r\n</b></h6><p>It acts as an antibiotic preventing various internal and external infections and is beneficial for brain and nervous system fighting many neurotic disorders. It also has memory boosting properties which prevents from long term side effects that may damage the brain by certain viruses in the latter\r\n</p><p><img src=\"https://shopiya.lk/public/uploads/all/f6URULUHpTjpDLW0yyb5tsTqALEZxws1efvqHpSV.jpg\" style=\"width: 472.778px;\"><br></p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-09-15 08:25:13', '2021-09-16 09:35:04'),
