(113, 117, 'Unisex Fashion Boys Girls Sports Running Shoes', 'pair', '<p><b>Product details&nbsp;</b></p><p><b><br></b>100% Synthetic</p><p>Flyknit constructed upper delivers zoned stretch and support\r\n</p><p>Auxetic outsole pattern expands with your step to provide flexible cushioning\r\n</p><p>Flywire technology woven into the upper integrates with the laces for a dynamic, supportive fit through the midfoot\r\n</p><p>Low- profile injected unit sole(IU) foam profides a resilient ride and is tough enough to double as an outsole, dramatically reducing the shoe`s overall weight\r\n</p><p>Anatomical heel is rounded to roll with the ground ,promoting a more natural range of motion</p>', 'en', '2021-09-28 06:33:00', '2021-09-28 06:40:29'),
(114, 118, 'Thermal Insulated Food Carrier Containers. 1.2/1.5 Ltr', '1', '<h4><b><font color=\"#ff0000\">Thermal Insulated Food Carrier Containers. 1.2/1.5 Ltr \r\n</font></b></h4><p>Store/Home &amp; Lifestyles/Dineware \r\n</p><p>Stainless Steel 12 hrs of Thermo Vacuum Insulated Leakproof Double Layer Food Storage Warmer. \r\n</p><p>SKU YA-INSULTDFOODCARY-M5-1.2L-RR \r\n</p><p>Storage Capacity \r\n</p><p>1.2 Ltr \r\n</p><p>1.5 Ltr \r\n</p><p>Colors \r\n</p><p>Rose Red \r\n</p><p>Wine Red \r\n</p><p>Product Details Weight: 0.95 kg \r\n</p><p>304 Stainless Steel 12 HOURS of Thermo Insulated Vacuum Food Storage Container with Carrier Handle. Double Layer Thermal Insulation. Bento Round Leakproof Food Warmer.Additional Bowl inside. Ant-Overflow Cover with Heat release knob. \r\n</p><p>Features: \r\n</p><p>	Material: 304 Stainless Steel Body and food grade PP Lid \r\n</p><p>	12 Hours of Thermal Vacuum Insulation \r\n</p><p>Stainless Steel Double Layer Round Bento Thermos Food Storage Container to keep the food warm and hot \r\n</p><p>	Comes with additional storage tray inside \r\n</p><p>	Keep overnight dinner and Have late lunch \r\n</p><p>	Food-grade stainless steel, strong and durable \r\n</p><p>	Ideal for using in home, office, school or outdoor activities \r\n</p><p>	Easy to clean, not easy to stick dirt, convenient to carry \r\n</p><p>	Color: Available in TWO colours: Rose Red and Wine Red (as shown in the pictures) \r\n</p><p><br></p><p> \r\n</p><p> \r\n</p><p>  \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p>', 'en', '2021-09-28 08:50:04', '2021-09-28 08:50:04'),
(115, 119, 'Thermal Insulated Food Containers. 1.0', '1', '<h4><b><font color=\"#ff0000\">Thermal Insulated Food Containers. 1.0 \r\n</font></b></h4><p>Store/Home &amp; Lifestyles/Dineware \r\n</p><p>Double Layer Stainless Steel Thermo Insulated Vacuum and Leakproof Food Storage Warmer. \r\n</p><p>SKU YA-INSULTDFOODCONT-M1-1L \r\n</p><p>Storage Capacity \r\n</p><p>1 Ltr \r\n</p><p>Product Details \r\n</p><p>Weight: 0.85 kg \r\n</p><p>Stainless Steel Thermo Insulated Vacuum Food Storage Container. Double Layer Thermal Insulation. Bento Round Leakproof Food Warmer. \r\n</p><p>Features:</p><p> \r\n</p><p>Stainless Steel Double Layer Round Bento Thermos Food Storage Container to keep the food warm and hot \r\n</p><p>Comes with additional storage tray inside \r\n</p><p>Keep overnight dinner and Have late lunch \r\n</p><p>Food-grade stainless steel, strong and durable \r\n</p><p>Ideal for using in home, office, school or outdoor activities \r\n</p><p>Easy to clean, not easy to stick dirt, convenient to carry \r\n</p><p>Color: Silver (as shown in the pictures) \r\n</p><p><br></p><p> \r\n</p><p> \r\n</p>', 'en', '2021-09-28 09:11:05', '2021-09-28 09:11:05'),
(116, 120, 'IKEA 365+ Food Container. Rectangular. Glass. 1 ltr', '1', '<h4><font color=\"#ff0000\"><b>IKEA 365+ Food Container. Rectangular. Glass. 1 ltr \r\n</b></font></h4><p>Store/Home &amp; Lifestyles/IKEA Collections \r\n</p><p>IKEA 365+ Food Container. Rectangular. Glass. 1 ltr \r\n</p><p>SKU IKEA-103.592.01 \r\n</p><p>Product Details \r\n</p><p>Brand: IKEA \r\n</p><p>Weight: 0.68 kg \r\n</p><p>Product description \r\n</p><p>Helps you take care of food  and the planet \r\n</p><p>If you want to reduce food waste but sometimes think its a bit of a pain to take care of your food, this might help. IKEA 365+ food storage products make it easier to store, save and bring food with you on the go. To get to know more about peoples needs, we visited families in several countries. We found out that its all about versatility and simplicity. \r\n</p><p>Youve just put leftovers after eating into a food container, but cant find a lid that fits. Or maybe youve put a food container in the fridge with food in it, but you cant see whats inside the food container and completely forget about the food. These were things we heard time and time again when interviewing families about their experiences. We wanted to develop products to make this easier, says David \r\n</p><p>Granath, a product developer who has worked with the project. They should be simple and flexible. \r\n</p><p>And easy to combine and use in ways that suit every household. \r\n</p><p>No extra work \r\n</p><p>It can involve things like using the same food container for several steps and just changing the lid. There shouldnt be any unnecessary extra work along the way, says David. Transparent containers increase the chances that the food is consumed. And it must be easy to adapt the containers to serve different needs. People asked for a coherent system for food storage. Not complicated special gadgets, yet rather simple and straightforward products that can be used often. \r\n</p><p>Smart and super simple \r\n</p><p>The IKEA 365+ food containers and lids can be combined and also come in different materials and sizes. They are super simple  and thats the point. Weve put a lot of work into them, for example by seeing to it that all the different parts fit together. But the product itself is simple in a smart way. We cant solve the entire food waste problem  but we can make it possible for everyone to be part of the solution. \r\n</p><p>The food container is made of oven-safe glass and can be used as an oven/serving dish. \r\n</p><p>Made of glass, which does not absorb odours or discolour from tomato sauce, etc, so the food container is easy to clean. \r\n</p><p>The transparent jar makes it easy to find what you are looking for, regardless of where it is placed. \r\n</p><p>Please refer to packaging label for country of origin Fits with IKEA 365+ rectangular-shaped lids. \r\n</p><p>Wash this product before using it for the first time. \r\n</p><p>Designer \r\n</p><p>Sarah Fager \r\n</p><p>Product dimensions \r\n</p><p>Length: 21 cm \r\n</p><p>Width: 15 cm \r\n</p><p>Height: 6 cm \r\n</p><p>Volume: 1.0 l \r\n</p><p>Care instructions Microwave-safe. \r\n</p><p>Freezer-safe. \r\n</p><p>Dishwasher-safe. \r\n</p><p>Oven-safe. \r\n</p><p>Environment and materials \r\n</p><p>Environment \r\n</p><p>No cadmium or lead added. \r\n</p><p>By creating products that help people minimize waste, we contribute to enabling a more sustainable life at home. \r\n</p><p>Materials \r\n</p><p>Heat resistant glass \r\n</p><p>Packaging info \r\n</p><p>IKEA 365+ \r\n</p><p>Food container \r\n</p><p>Width15 Cm \r\n</p><p>Height6 Cm \r\n</p><p>Length21 Cm \r\n</p><p>Weight0.68 Kg \r\n</p><p>Number of packages 1 \r\n</p><p>Designers concept \r\n</p><p>Borosilicate glass can handle conditions that are a bit too tough for ordinary household glass. Its very impact and scratch resistant and withstands rapid temperature changes, allowing you to take it directly from the freezer to the oven  or vice versa. And if it somehow breaks, it shatters into large pieces with less risk of someone getting hurt. Simply a tougher type of glass. \r\n</p><p><br></p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p>', 'en', '2021-09-28 09:17:31', '2021-09-28 09:17:31'),
(117, 121, 'IKEA 365+ Food Container. Round. Glass. 600 ml', '1', '<h4><font color=\"#ff0000\"><b>IKEA 365+ Food Container. Round. Glass. 600 ml \r\n</b></font></h4><p>Store/Home &amp; Lifestyles/IKEA Collections \r\n</p><p>IKEA 365+ Food Container. Round. Glass. 600 ml \r\n</p><p>SKU IKEA-103.591.97 \r\n</p><p>Product Details \r\n</p><p>Brand: IKEA \r\n</p><p>Weight: 0.46 kg \r\n</p><p>Product description \r\n</p><p>Helps you take care of food  and the planet \r\n</p><p>If you want to reduce food waste but sometimes think its a bit of a pain to take care of your food, this might help. IKEA 365+ food storage products make it easier to store, save and bring food with you on the go. To get to know more about peoples needs, we visited families in several countries. We found out that its all about versatility and simplicity. \r\n</p><p>Youve just put leftovers after eating into a food container, but cant find a lid that fits. Or maybe youve put a food container in the fridge with food in it, but you cant see whats inside the food container and completely forget about the food. These were things we heard time and time again when interviewing families about their experiences. We wanted to develop products to make this easier, says David \r\n</p><p>Granath, a product developer who has worked with the project. They should be simple and flexible. \r\n</p><p>And easy to combine and use in ways that suit every household. \r\n</p><p>No extra work \r\n</p><p>It can involve things like using the same food container for several steps and just changing the lid. There shouldnt be any unnecessary extra work along the way, says David. Transparent containers increase the chances that the food is consumed. And it must be easy to adapt the containers to serve different needs. People asked for a coherent system for food storage. Not complicated special gadgets, yet rather simple and straightforward products that can be used often. \r\n</p><p>Smart and super simple \r\n</p><p>The IKEA 365+ food containers and lids can be combined and also come in different materials and sizes. They are super simple  and thats the point. Weve put a lot of work into them, for example by seeing to it that all the different parts fit together. But the product itself is simple in a smart way. We cant solve the entire food waste problem  but we can make it possible for everyone to be part of the solution. \r\n</p><p>The food container is made of oven-safe glass and can be used as an oven/serving dish. \r\n</p><p>Made of glass, which does not absorb odours or discolour from tomato sauce, etc, so the food container is easy to clean. \r\n</p><p>The transparent jar makes it easy to find what you are looking for, regardless of where it is placed. \r\n</p><p>Please refer to packaging label for country of origin Fits with IKEA 365+ round-shaped lids. \r\n</p><p>Wash this product before using it for the first time. \r\n</p><p>Designer \r\n</p><p>Sarah Fager \r\n</p><p>Product dimensions \r\n</p><p>Height: 8 cm \r\n</p><p>Diameter: 14 cm \r\n</p><p>Volume: 600 ml \r\n</p><p>Care instructions Microwave-safe. \r\n</p><p>Freezer-safe. \r\n</p><p>Dishwasher-safe. \r\n</p><p>Oven-safe \r\n</p><p>Environment and materials \r\n</p><p>Environment \r\n</p><p>No cadmium or lead added. \r\n</p><p>Materials \r\n</p><p>Heat resistant glass \r\n</p><p>Packaging info \r\n</p><p>IKEA 365+ \r\n</p><p>Food container \r\n</p><p>Length8 Cm \r\n</p><p>Diameter14 Cm \r\n</p><p>Weight0.43 Kg \r\n</p><p>Number of packages 1 \r\n</p><p>Designers concept \r\n</p><p>Borosilicate glass can handle conditions that are a bit too tough for ordinary household glass. Its very impact and scratch resistant and withstands rapid temperature changes, allowing you to take it directly from the freezer to the oven  or vice versa. And if it somehow breaks, it shatters into large pieces with less risk of someone getting hurt. Simply a tougher type of glass. \r\n</p><p><br></p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p>', 'en', '2021-09-28 09:23:00', '2021-09-28 09:23:00'),
(118, 122, 'IKEA FRVAR Glass Jar with Lid. 1.8 ltr', '1', '<h4><b><font color=\"#ff0000\">IKEA FRVAR Glass Jar with Lid. 1.8 ltr \r\n</font></b></h4><p>Store/Home &amp; Lifestyles/IKEA Collections \r\n</p><p>Creative Design Body or Bottom Standing Glass Jar for Convenient Storage Use. \r\n</p><p>SKU IKEA-502.024.87 \r\n</p><p>Product Details \r\n</p><p>Brand: IKEA \r\n</p><p>Weight: 0.84 kg \r\n</p><p>Product description \r\n</p><p>The contents are easy to reach as the opening is on the front. \r\n</p><p>The transparent jar makes it easy to find what you are looking for, regardless of where it is placed. \r\n</p><p>You can reduce your food waste by storing your dry foods in a jar with a tight-fitting lid, because it keeps the food fresh longer. \r\n</p><p>Please refer to packaging label for country of origin \r\n</p><p>Wash this product before using it for the first time. \r\n</p><p>Designer \r\n</p><p>Carl jerstam \r\n</p><p>Product dimensions \r\n</p><p>Height: 18 cm \r\n</p><p>Volume: 1.8 l \r\n</p><p>Care instructions \r\n</p><p>Dishwasher-safe. \r\n</p><p>Environment and materials \r\n</p><p>Environment \r\n</p><p>The material in this product may be recyclable. Please check the recycling rules in your community and if recycling facilities exist in your area. \r\n</p><p>Materials \r\n</p><p>Jar :Glass \r\n</p><p>Lid: Polypropylene plastic \r\n</p><p>Packaging info \r\n</p><p>FRVAR \r\n</p><p>Jar with lid \r\n</p><p>Width17 Cm \r\n</p><p>Height13 Cm \r\n</p><p>Length18 Cm \r\n</p><p>Weight0.84 Kg \r\n</p><p>Number of packages 1 \r\n</p><p>Designers concept \r\n</p><p>Glass doesnt absorb food flavours, colours or odours. For instance, you can use the same glass jar first for onions then for raspberries, and the raspberries wont taste of onion. As long as you wash the jar between foods. And unlike plastic, glass doesnt stain. Not even from tomato sauce or blueberries. Thats what you call a clear advantage. \r\n</p><p><br></p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p>', 'en', '2021-09-28 09:28:02', '2021-09-28 09:28:02'),
(119, 123, 'Oil Frying Strainer Clip Clamp Spoon', '1', '<h4><font color=\"#ff0000\"><b>Oil Frying Strainer Clip Clamp Spoon \r\n</b></font></h4><p>Store/Home &amp; Lifestyles/Kitchen \r\n</p><p>SKU YA-OILSTRAINSPOON-1CV179 \r\n</p><p>Product Details \r\n</p><p>Weight: 0.25 kg \r\n</p><p>Strainer Clip Stainless Steel Oil-frying Clamp Spoon. Fried Food Cooking Tools Kitchen Gadgets. M/NO: 1CV179 \r\n</p><p><br></p><p> \r\n</p>', 'en', '2021-09-28 09:32:24', '2021-09-28 09:32:24'),
