(121, 125, '50ml Hand Sanitizer Flip Top Cap', '1', '<h4><b><font color=\"#295218\">50ml Flip Top Cap</font></b></h4><p> 75% Alcohol (WHO recommended alcohol content)<br></p><p> No residual activity\r\n</p><p> No bleach\r\n</p><p> Anti-bacterial, Anti- Fungal, Antiviral\r\n</p><p> Moisturizes your hands\r\n</p><p> Approved by Health Ministry &amp; NMRA\r\n</p><p> Highly endorsed &amp; recommended by medical professionals</p><p>MediSafe is the product of years of research and development by MW Lifesciences. MediSafe is a premium alcohol-based hand sanitizer. MediSafe hand disinfectant is a complete bactericidal, viricidal, and fungicidal alcohol-based hand-rub disinfectant manufactured in accordance with USP formula and WHO guidelines.\r\n</p><p>Composition:\r\n</p><p>Isopropyl Alcohol  75% (v/v)\r\n</p><p>Hydrogen Peroxide  0.125% (v/v)\r\n</p><p>Glycerine BP  1.45% (v/v)\r\n</p><p>Aqua QS</p><p><b><font color=\"#ff0000\">DIRECTIONS TO USE :</font></b></p><p>Hygenic Hand Disinfection:\r\n</p><p>Rub Medisafe (3ml) 21.5ml pushes from the calibrated pump, Thoroughly clean area of hands, nail grooves for 30 seconds.\r\n</p><p>Surgical Hand Disinfection: \r\n</p><p>Rub Medisafe (9ml) 61.5ml pushes from the calibrated pump, Thoroughly clean area of hands, nail grooves for 30 seconds.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-09-29 12:02:06', '2021-09-30 07:29:15'),
